INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (27401, 28061, 'Terbinafine', 'Liver Diseases', 'Oral terbinafine is not recommended for use in patients with chronic or active liver disease.  Terbinafine may be hepatotoxic.  Rare cases of cholestatic hepatitis and liver failure, some resulting in liver transplant or death, have been reported during treatment of various dermatologic conditions in patients with and without preexisting liver disease.  Although a causal relationship has not been established, the severity of hepatic events and/or their outcome may be worse in patients with active or chronic liver disease.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (27402, 28436, 'Terbinafine', 'Liver Diseases', 'Oral terbinafine is not recommended for use in patients with chronic or active liver disease.  Terbinafine may be hepatotoxic.  Rare cases of cholestatic hepatitis and liver failure, some resulting in liver transplant or death, have been reported during treatment of various dermatologic conditions in patients with and without preexisting liver disease.  Although a causal relationship has not been established, the severity of hepatic events and/or their outcome may be worse in patients with active or chronic liver disease.', '3', '', 'DDInter', 0);
