INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (27405, 5201, 'Terbinafine', 'Neutropenia', 'Isolated cases of severe neutropenia have been reported in patients administered oral terbinafine.  A causal relationship has not been established, although the neutropenia resolved following discontinuation of terbinafine with or without supportive care.  Therapy with terbinafine should be administered cautiously in patients with preexisting neutropenia.  It may be appropriate to monitor blood counts more frequently during terbinafine therapy.  If secondary infection occurs and the neutrophil count is <= 1000 cells/mm3, terbinafine should be discontinued and supportive management initiated.', '3', '', 'DDInter', 0);
