INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (27437, 5201, 'Terbinafine', 'Depressive Disorder', 'Postmarketing studies have reported depressive symptoms with the use of terbinafine tablets.  Terbinafine should be used with caution in patients with depression, and prescribers should be alert to the development of depressive symptoms.  Patients and caregivers should be instructed to report any depressive symptoms.', '2', '', 'DDInter', 0);
